#include <iostream>#include <vector>using namespace std;int main() {	int m, n;	scanf("%d%d", &m, &n);	vector<bool>check(n+1,true);		check[1] = false; //소수가 아님!	for (int i = 2; i <= n; i++) {			for (int j = 2; i * j <= n; j++) { //소수가 아닌 경우				check[i * j] = false;  //false로 초기화			}	}	for (int i = m; i <= n; i++) {		if (check[i] == true) {			printf("%d\n", i);		}	}}